('abt1', 'Nice Product Powered By Panacea-Soft', 'Panacea-Soft is a software development team that focuses on helping your business with mobile and web technology.We tried our best to delivery quality product on time according clientâ€™s requirements and exceptions. We are technology oriented team so before we code, we analyse for your requirements and brain storm then start for development. We donâ€™t over promise to client and trying our best to deliver awesome product package. Thanks for reaching out to us. We are happy to listen your world and enjoy to solve the problem using technology.', 'teamps.is.cool@gmail.com', '+9592540942**', 'http://www.panacea-soft.com', 1, 'ca-pub-7127831079008160', '6882887537', 1, 'UA-79164209-2', 'http://www.facebook.com', 'gp1', 'in1', 'yo1', 'pi1', 'tw1', 'A privacy policy is a legal statement that discloses how a party gathers, stores, and uses the personal information it collects. Personal information refers to anything that can be used to identify an individual, including names, phone numbers, email addresses, device IDs, and locations.\r\n\r\n\r\nThese policies are used by companies and mobile app developers to stay compliant with federal laws. They fulfill the legal requirement to safeguard user privacy while also protecting the company itself from legal challenges.\r\n\r\n\r\nThe contents of these policies can vary greatly depending on the industry, user demographics, governing laws and jurisdictions, and application platform. Employing the use of third party services may also affect the need for one, as well as its contents–even if the app itself doesn’t collect user information.', '', 50);
